import { IconButton, Typography,AppBar,Toolbar,Button,Container,Grid, ButtonGroup,Card,Paper, TextField,Box} from "@material-ui/core";
import MenuIcon from '@material-ui/icons/Menu';
import AddIcon from '@material-ui/icons/Add';
import EditIcon from '@material-ui/icons/Edit';
import SearchIcon from '@material-ui/icons/Search';
import { Search } from "@material-ui/icons";
const In=()=>{
    return(
<Container>
    <Appbar/>
    <Grid container spacing={2}>
        <Grid item xs={12}>
            <Typography variant="h4" style={{color:"grey"}}>
                Inbound
            </Typography>
            </Grid>
            <Grid item xs={12}>
            <ButtonGroup>
                <Button><AddIcon/></Button>
                <Button><EditIcon/></Button>
                <Button><SearchIcon/></Button>
            </ButtonGroup>
            </Grid>
            <Grid item xs={12}>
                <Paper>
        <Grid item xs={8}><Card><POHead/></Card></Grid>
        <Grid item xs={12}>
            <PODetails/>
        </Grid>
    </Paper>
    </Grid>
    </Grid>
</Container>
    );
}
export default In;
const Appbar = ()=>{
    return(
    <AppBar position="static">
    <Toolbar>
        <IconButton edge="start">
            <MenuIcon/>
        </IconButton>
        <Typography variant="h6" style={{flexGrow:1}}>
            In/Out Stock
        </Typography>
        <Button color="inherit">
            Logout
        </Button>
    </Toolbar>
</AppBar>
    );
}

const POHead=()=>{
    return(
        <Grid container style={{margin:20,padding:10}}>
            <Grid item xs={3}>
            <TextField label="Doc Number"></TextField></Grid>
            <Grid item xs={3}><TextField label="Supplier"></TextField></Grid>
            <Grid item xs={3}><TextField label="PO Number"></TextField>
            </Grid><Grid item xs={3}><TextField label="Date"></TextField></Grid>        
        </Grid>
    );
}

const PODetails=()=>{
    return(
        <Box style={{marginTop:20}}>
        <Grid container spacing={6}>
            <Grid  item >Sl. no</Grid>
            <Grid  item ><TextField label="Barcode"></TextField></Grid>
            <Grid  item ><TextField label="Product Code"></TextField></Grid>
            <Grid  item ><TextField label="Product Description"></TextField></Grid>
            <Grid  item ><TextField label="Unit"></TextField></Grid>
            <Grid  item ><TextField label="Qty"></TextField></Grid>
            <Grid  item ><TextField label="Location"></TextField></Grid>
            <Grid  item ><TextField label="Fr"></TextField></Grid>
            <Grid  item ><TextField label="Quantity"></TextField></Grid>
        </Grid>
        </Box>

    );
}
